import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import 'bootstrap/dist/css/bootstrap.min.css';
import Accordion from "./components/Accordion";
ReactDOM.render(
  <React.StrictMode>
    <App />
    <Accordion title />
  </React.StrictMode>,
  document.getElementById('root')
);
